import React from 'react';
import './App.css';

function Header() {
  return (
    <div className="header">
      <h1>Bank Hero</h1>
      <ul>
        <li>
          <Link to="/public">Public Page</Link>
        </li>
        <li>
          <Link to="/protected">Protected Page</Link>
        </li>
      </ul>

    </div>
  );
}

export default Header;
